import btnimg from '../../assects/Introbtn.png'

const Intro = () => {
  return (
    <section id='intro'>
        <div className="introContent">
            <span className='hello'>Hello,</span>
            <span className="intotext">Im <span className="intorname">Ayodeji</span> <br /> Technical Engineer </span>
            <p className="intropar">A reliable customer-focused IT Analyst with a broad range of 
            <br />operational and IT support skills.Regular contribution of ideas <br />
            and solutions for changes to IT helpdesk processes and quality <br />
            procedures brings about significant progress within <br />
            the Technical Support Team. A good team player with an excellent proactive approach <br />
            to problem-solving and very focused on implementing the team's collective goals. Currently seeking new career 
            <br />challenges to make significant contributions in a goal-driven environment which offers responsibility with 
            scope for further development.</p>
            <Link><button className='btn'><img src={ btnimg } alt="" className='btnimg'/>Download RM</button></Link>

        </div>
        <div className="skillsContent">

        </div>
    </section>

  )
}

export default Intro;
